import { StyleSheet } from 'react-native'
import colors from '../../constants/colors'

const styles = StyleSheet.create({
    background: {
        width: '100%',
        height: '100%',
        backgroundColor: colors.dark
    },
    icon: {
        width: 24,
        height: 24,
    },
    input: {
        backgroundColor: 'white',
        width: 240,
        height: 44,
        borderRadius: 8,
        paddingHorizontal: 12,
    }
})

export default styles
